import React, { Component } from 'react';
import  { TextField, Button } from '@material-ui/core';

class CompEmailForm extends Component{
    handleChange(event){
        this.props.handleUpdate(event);
    }
    render() {
        const {
            email, subject, body, handleSubmit
        } = this.props;

        return (
            <form>
                <TextField
                    id="email"
                    name="email"
                    label="recipient"
                    onChange={this.handleChange.bind(this)}
                    value={email}
                />
                <br/>
                <TextField
                    id="subject"
                    name="subject"
                    label="Subject"
                    onChange={this.handleChange.bind(this)}
                    value={subject}
                />
                <br/>
                <TextField
                    id="body"
                    name="body"
                    label="Body"
                    onChange={this.handleChange.bind(this)}
                    value={body}
                />
                <Button className="submit" onClick={handleSubmit}>Send</Button>
            </form>
        );
    }
}
export default CompEmailForm;
